DROP TABLE TPG_ROLE CASCADE CONSTRAINTS;
DROP TABLE TPG_USERROLE CASCADE CONSTRAINTS;
DROP TABLE TPG_USUARIOS CASCADE CONSTRAINTS;
DROP TABLE TPGC_ESTADOS CASCADE CONSTRAINTS;
DROP TABLE TPGC_PERMISO CASCADE CONSTRAINTS;
DROP TABLE TPGC_AREA CASCADE CONSTRAINTS;
DROP TABLE TPGC_MEDIDA CASCADE CONSTRAINTS;
DROP TABLE TPGC_UBICACION CASCADE CONSTRAINTS;
DROP TABLE TPG_REQUERIMIENTO CASCADE CONSTRAINTS;
DROP TABLE TPG_REQADDON CASCADE CONSTRAINTS;


DROP SEQUENCE STPGUID;
DROP SEQUENCE STPGRID;
DROP SEQUENCE STPTPGCEID;
DROP SEQUENCE STPGCPID;
DROP SEQUENCE STPGCAID;
DROP SEQUENCE STPGCUMID;
DROP SEQUENCE STPGTPGREQID;
DROP SEQUENCE STPGTPGCOID;
DROP SEQUENCE STPGTPGSOID;
----------------------------- TABLES -----------------------------
CREATE TABLE TPG_USUARIOS(
    TPGUID NUMERIC,
    USERNAME VARCHAR2(10) UNIQUE,
    NAME VARCHAR2(150),
    PASSWORD VARCHAR2(350),
    ENABLED NUMERIC DEFAULT 1,
    CREATED DATE,
    MODIFIED DATE
);
CREATE TABLE TPG_ROLE(
    TPGRID NUMERIC,
    ROLE VARCHAR2(20),
    DESCRIPCION VARCHAR2(100),
    ENABLED NUMERIC DEFAULT 1,
    CREATED DATE,
    MODIFIED DATE
);
CREATE TABLE TPG_USERROLE(
    TPGUID NUMERIC,
    TPGRID NUMERIC
);
CREATE TABLE TPGC_ESTADOS(
    TPGCEID NUMERIC,
    ESTADO VARCHAR2(20),
    DESCRIPCION VARCHAR2(100),
    ENABLED NUMERIC DEFAULT 1,
    CREATED DATE,
    MODIFIED DATE
);
CREATE TABLE TPGC_PERMISO(
    TPGCPID NUMERIC,
    PERMISO VARCHAR2(20),
    DESCRIPCION VARCHAR2(100),
    ENABLED NUMERIC DEFAULT 1,
    CREATED DATE,
    MODIFIED DATE
);
CREATE TABLE TPGC_AREA(
    TPGCAID NUMERIC,
    AREA VARCHAR2(20),
    DESCRIPCION VARCHAR2(100),
    ENABLED NUMERIC DEFAULT 1,
    CREATED DATE,
    MODIFIED DATE
);
CREATE TABLE TPGC_MEDIDA(
    TPGCUMID NUMERIC,
    UMEDIDA VARCHAR2(20),
    DESCRIPCION VARCHAR2(100),
    ENABLED NUMERIC DEFAULT 1,
    CREATED DATE,
    MODIFIED DATE
);

CREATE TABLE TPGC_UBICACION(
    TPGCUID NUMERIC,
    NAME VARCHAR2(100),
    REFERENCEID NUMERIC,
    ENABLED NUMERIC,
    CREATED DATE,
    MODIFIED DATE
);
CREATE TABLE TPG_REQUERIMIENTO(
    TPGREQID NUMERIC,
    TPGCPID NUMERIC,
    TPGCUID NUMERIC,
    TPGCUIDREF NUMERIC,
    VIGENCIA NUMERIC,
    TPGCUMID NUMERIC,
    TPGCAID NUMERIC,
    DATEREQ DATE,
    DETEEND DATE,
    TPGCEID NUMERIC,
    DATEMOD DATE
);
CREATE TABLE TPGC_SOLICITUD(
    TPGCSID NUMERIC,
    SOLICITUD VARCHAR2(20),
    DESCRIPCION VARCHAR2(100),
    ENABLED NUMERIC DEFAULT 1,
    CREATED DATE,
    MODIFIED DATE
);
CREATE TABLE TPGC_COBERTURA(
    TPGCCID NUMERIC,
    COBERTURA VARCHAR2(20),
    DESCRIPCION VARCHAR2(100),
    ENABLED NUMERIC DEFAULT 1,
    CREATED DATE,
    MODIFIED DATE
);
CREATE TABLE TPGC_ACTIVIDAD(
    TPGCACID NUMERIC,
    ACTIVIDAD VARCHAR2(20),
    DESCRIPCION VARCHAR2(100),
    ENABLED NUMERIC DEFAULT 1,
    CREATED DATE,
    MODIFIED DATE
);
CREATE TABLE TPG_REQADDON(
    TPGREQID NUMERIC,
    FOLIO VARCHAR2(25),
    IMPORTE NUMBER(10,4),
    PAYDATE DATE,
    REGISTROC VARCHAR2(100),
    NOMBRECONT VARCHAR2(250),
    PROVEEDOR VARCHAR2(250),
    SISTEMA VARCHAR2(250),
    TPGCSID NUMERIC,
    FEGRESO VARCHAR2(25),
    TPGCAID NUMERIC,
    CC VARCHAR2(250),
    NOMBRECC VARCHAR2(250),
    POSTFIN VARCHAR2(250),
    INCPERMISO VARCHAR2(250),
    HORARIO VARCHAR2(25),
    NEGACION VARCHAR2(250),
    CANTIDAD NUMERIC,
    VIGENCIA NUMERIC,
	TPGCUMID NUMERIC,
    FORMAPAGO VARCHAR2(250),
    TPGCCID NUMERIC,
	TPGCACID NUMERIC,
	DESCRIPCION VARCHAR2(500)
);
CREATE TABLE TPG_BITACORA(
        TGPIDB NUMERIC,
        DESCRIPCION VARCHAR2(500),
        TPGUID NUMERIC,
        TPGREQID NUMERIC,
        LASTDATE DATE
);

----------------------------- COMENTARIOS -----------------------------
COMMENT ON COLUMN TPG_REQUERIMIENTO.TPGCPID IS 'TIPO REQUERIMIENTO';
COMMENT ON COLUMN TPG_REQUERIMIENTO.TPGCUID IS 'UBICACION ESTADO';
COMMENT ON COLUMN TPG_REQUERIMIENTO.TPGCUIDREF IS 'UBICACION MUNICIPIO';
COMMENT ON COLUMN TPG_REQUERIMIENTO.VIGENCIA IS 'VIGENCIA DEL REQUERIMIENTO';
COMMENT ON COLUMN TPG_REQUERIMIENTO.DATEREQ IS 'FECHA DEL REQUERIMIENTO';
COMMENT ON COLUMN TPG_REQUERIMIENTO.DETEEND IS 'FECHA VENCIMINEOT DEL REQUERIMIENTO';
COMMENT ON COLUMN TPG_REQUERIMIENTO.TPGCEID IS 'ESTADO DEL REQUERIMIENTO';
COMMENT ON COLUMN TPG_REQUERIMIENTO.TPGCAID IS 'AREA DEL REQUERIMIENTO';
COMMENT ON COLUMN TPG_REQUERIMIENTO.TPGCUMID IS 'UNIDAD MEDIDA DE VIGENCIA';
----------------------------- PRIMARY KEYS -----------------------------
ALTER TABLE TPG_USUARIOS ADD CONSTRAINT PKTPUSERG PRIMARY KEY (TPGUID);
ALTER TABLE TPG_ROLE ADD CONSTRAINT PKTPROLG PRIMARY KEY (TPGRID);
ALTER TABLE TPG_USERROLE ADD CONSTRAINT PKTPURG PRIMARY KEY (TPGUID, TPGRID);
ALTER TABLE TPGC_ESTADOS ADD CONSTRAINT PKTPGCEID PRIMARY KEY (TPGCEID);
ALTER TABLE TPGC_PERMISO ADD CONSTRAINT PKTPGCPID PRIMARY KEY (TPGCPID);
ALTER TABLE TPGC_AREA ADD CONSTRAINT PKTPGCAID PRIMARY KEY (TPGCAID);
ALTER TABLE TPGC_MEDIDA ADD CONSTRAINT PKTTPGCUMID PRIMARY KEY (TPGCUMID);
ALTER TABLE TPGC_UBICACION ADD CONSTRAINT PKTPGCUID PRIMARY KEY (TPGCUID);
ALTER TABLE TPG_REQUERIMIENTO ADD CONSTRAINT PKTPGREQID PRIMARY KEY (TPGREQID);
ALTER TABLE TPGC_SOLICITUD ADD CONSTRAINT PKTPUSID PRIMARY KEY (TPGCSID);
ALTER TABLE TPGC_COBERTURA ADD CONSTRAINT PKTPUCID PRIMARY KEY (TPGCCID);
ALTER TABLE TPGC_ACTIVIDAD ADD CONSTRAINT PKTPUACID PRIMARY KEY (TPGCACID);
----------------------------- FOREIGN KEYS -----------------------------
ALTER TABLE TPG_USERROLE ADD CONSTRAINT FKTPUSERG FOREIGN KEY (TPGUID) REFERENCES TPG_USUARIOS(TPGUID);
ALTER TABLE TPG_USERROLE ADD CONSTRAINT FKTROLG FOREIGN KEY (TPGRID) REFERENCES TPG_ROLE(TPGRID);
ALTER TABLE TPGC_UBICACION ADD CONSTRAINT FKTPGCUID FOREIGN KEY (REFERENCEID) REFERENCES TPGC_UBICACION(TPGCUID);
ALTER TABLE TPG_REQADDON ADD CONSTRAINT FKTPTPGREQID FOREIGN KEY (TPGREQID) REFERENCES TPG_REQUERIMIENTO(TPGREQID);
ALTER TABLE TPG_REQADDON ADD CONSTRAINT FKTPGIR FOREIGN KEY (TPGREQID) REFERENCES TPG_REQUERIMIENTO(TPGREQID);
ALTER TABLE TPG_REQADDON ADD CONSTRAINT FKTPGICA FOREIGN KEY (TPGCAID) REFERENCES TPGC_AREA(TPGCAID);
ALTER TABLE TPG_REQADDON ADD CONSTRAINT FKTPGICM FOREIGN KEY (TPGCUMID) REFERENCES TPGC_MEDIDA(TPGCUMID);
ALTER TABLE TPG_REQADDON ADD CONSTRAINT FKTPGICS FOREIGN KEY (TPGCCID) REFERENCES TPGC_COBERTURA(TPGCCID);
ALTER TABLE TPG_REQADDON ADD CONSTRAINT FKTPGICC FOREIGN KEY (TPGCSID) REFERENCES TPGC_SOLICITUD(TPGCSID);
ALTER TABLE TPG_REQADDON ADD CONSTRAINT FKTPGICAC FOREIGN KEY (TPGCACID) REFERENCES TPGC_ACTIVIDAD(TPGCACID);
----------------------------- SEQUENCE -----------------------------
